public Object getValue(Object val) 
{
	String phoneNumber = getPhoneNumberTextField().getText().trim();
	
	if (val instanceof com.cannontech.database.data.multi.SmartMultiDBPersistent) 
	{			
		((RemoteBase) ((com.cannontech.database.data.multi.SmartMultiDBPersistent) val).getOwnerDBPersistent()).getDeviceDialupSettings().setPhoneNumber( phoneNumber );
		((RemoteBase) ((com.cannontech.database.data.multi.SmartMultiDBPersistent) val).getOwnerDBPersistent()).getDeviceDialupSettings().setMaxConnectTime( new Integer(10) );
		((RemoteBase) ((com.cannontech.database.data.multi.SmartMultiDBPersistent) val).getOwnerDBPersistent()).getDeviceDialupSettings().setMinConnectTime( new Integer(0) );
		((RemoteBase) ((com.cannontech.database.data.multi.SmartMultiDBPersistent) val).getOwnerDBPersistent()).getDeviceDialupSettings().setLineSettings( "8N1" );
	}
	else
	{
		((RemoteBase) val).getDeviceDialupSettings().setPhoneNumber( phoneNumber );
		((RemoteBase) val).getDeviceDialupSettings().setMaxConnectTime( new Integer(30) );
		((RemoteBase) val).getDeviceDialupSettings().setMinConnectTime( new Integer(0) );
		((RemoteBase) val).getDeviceDialupSettings().setLineSettings( "8N1" );
	}

	
	return val;
}
